create table "region"
(
    "enabled"      BOOLEAN,
    "created_at"   TIMESTAMP,
    "id"           BIGINT auto_increment
        primary key,
    "parent_id"    BIGINT,
    "updated_at"   TIMESTAMP,
    "name_english" CHARACTER VARYING(255),
    "name_korean"  CHARACTER VARYING(255),
    "uuid"         CHARACTER VARYING(255),
    constraint "FKo91ep1bs7yb83bihquyrgixbm"
        foreign key ("parent_id") references "region"
);

comment
    on column "region"."enabled" is '활성화 여부';

comment
    on column "region"."created_at" is '생성일';

comment
    on column "region"."parent_id" is '상위 지역 식별자';

comment
    on column "region"."updated_at" is '수정일';

comment
    on column "region"."uuid" is '고유번호';

