    on column "importer"."enabled" is '활성화 여부';

comment
    on column "importer"."created_at" is '생성일';

comment
    on column "importer"."updated_at" is '수정일';

comment
    on column "importer"."name" is '수입사명';

comment
    on column "importer"."uuid" is '고유번호';

