create table "grape_share"
(
    "enabled"    BOOLEAN,
    "share"      REAL,
    "created_at" TIMESTAMP,
    "grape_id"   BIGINT,
    "id"         BIGINT auto_increment
        primary key,
    "region_id"  BIGINT,
    "updated_at" TIMESTAMP,
    "uuid"       CHARACTER VARYING(255),
    constraint "FKbd3treaefwqssdhbatw395ebt"
        foreign key ("region_id") references "region",
    constraint "FKja01rvw956xpn1p3s3dskpfm4"
        foreign key ("grape_id") references "grape"
);

