create table "wine"
(
    "acidity"             INTEGER,
    "alcohol"             REAL,
    "body"                INTEGER,
    "enabled"             BOOLEAN,
    "price"               INTEGER,
    "score"               REAL,
    "serving_temperature" REAL,
    "sweetness"           INTEGER,
    "tannin"              INTEGER,
    "created_at"          TIMESTAMP,
    "id"                  BIGINT auto_increment
        primary key,
    "importer_id"         BIGINT,
    "region_id"           BIGINT,
    "updated_at"          TIMESTAMP,
    "winery_id"           BIGINT,
    "grade"               CHARACTER VARYING(255),
    "name_english"        CHARACTER VARYING(255),
    "name_korean"         CHARACTER VARYING(255),
    "style"               CHARACTER VARYING(255),
    "type"                CHARACTER VARYING(255),
    "uuid"                CHARACTER VARYING(255),
    constraint "FK2wl8di3uwnq569tqnjd15qces"
        foreign key ("importer_id") references "importer",
    constraint "FK50l4savxjl7lejj0f9nsa9b1u"
        foreign key ("winery_id") references "winery",
    constraint "FKf5l1baopkf5c6hrhph45kfjf"
        foreign key ("region_id") references "region"
);

comment on column "wine"."enabled" is '활성화 여부';

comment on column "wine"."created_at" is '생성일';

comment on column "wine"."importer_id" is '수입사 식별자';

comment on column "wine"."region_id" is '지역 식별자';

comment on column "wine"."updated_at" is '수정일';

comment on column "wine"."winery_id" is '와이너리 식별자';

comment on column "wine"."type" is '와인의 종류';

comment on column "wine"."uuid" is '고유번호';

